// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol"; // This provides the ERC721 standard implementation.
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./IL1ERC721Bridge.sol";
import "@matterlabs/zksync-contracts/l2/contracts/L2ContractHelper.sol";

contract L2ERC721Bridge is IL1ERC721Bridge, ReentrancyGuard {
    IERC721 public token;

    address public l1Bridge;

    event DepositFinalized(uint256 tokenId, address indexed to);
    event WithdrawalInitiated(uint256 tokenId, address indexed to);

    constructor(address _token) {
        require(_token != address(0), "Invalid token address");
        token = IERC721(_token);
    }

    function setL1BridgeAddress(address _l1Bridge) public {
        require(_l1Bridge != address(0), "Invalid L1 bridge address");
        l1Bridge = _l1Bridge;
    }

    function finalizeDeposit(uint256 tokenId, address to) external override {
        require(msg.sender == l1Bridge, "Only L1 bridge can call");
        token.safeTransferFrom(address(this), to, tokenId); // This is the correct use of safeTransferFrom
        emit DepositFinalized(tokenId, to);
    }

    function initiateWithdrawal(uint256 tokenId, address to) external override {
        token.safeTransferFrom(msg.sender, address(this), tokenId);
        bytes memory data = abi.encodeWithSignature("finalizeWithdrawal(uint256,address)", tokenId, to);
        L2ContractHelper.sendMessageToL1(data);
        emit WithdrawalInitiated(tokenId, to);
    }
}

